import React from 'react';
import {
  Label,
  Image,
  Container
} from 'semantic-ui-react';

export default () => (
  <Container>
    <Label attached="top" color="black" size="massive">Fantasy Soccer Predictor</Label>
    <Image
      size="small"
      src="./pic.png"
    />
  </Container>
);
